import React from 'react';


function Header() {
    
    const edad = 19;
    let mensaje;

    if(edad === 18){
        mensaje = "MAyor de edad"
    }else{
        mensaje = "Eres menor"
    }

    return(
    <h1>{mensaje} {edad}</h1>
    )
}

export default Header;
